import React from "react";
import NewTemplate from "./_entry";
import TemplateList from "./_list";

import {
  Breadcrumb,
  Form,
  Input,
  Button,
  Table,
  message,
  Popconfirm,
  Space,
} from "antd";
import {
  EditOutlined,
  DeleteOutlined,
  SearchOutlined,
} from "@ant-design/icons";

class Main extends React.Component {

  render() {
    return(
      <>
      <NewTemplate/>
      <TemplateList/>
      </>
    );
  }
}

export default Main;
